// Function returns number of quarter (1,2,3,4) by date
function getQuarter(dateSeconds) {
  var dt = new Date(dateSeconds*1000);
  var month = dt.getMonth()+1;
  if (month<4) return 1;
  if (month<7) return 2;
  if (month<10) return 3;
  return 4;
}

// Function formats date
function formatDate(dateSeconds) {
  var dt = new Date(dateSeconds*1000);
  var day = dt.getDay(); if (day<10) day = "0"+day;
  var month = dt.getMonth()+1; if (month<10) month = "0"+month;
  var year = dt.getFullYear();
  var hour = dt.getHours(); if (hour<10) hour = "0"+hour;
  var minute = dt.getMinutes(); if (minute<10) minute = "0"+minute;
  var second = dt.getSeconds(); if (second<10) second = "0"+second;
  return day+"."+month+"."+year+" "+hour+":"+minute+":"+second;
}

